import React, { Component } from 'react';
import './App.css';
import Todo from './Todo';

class App extends Component {
  render() {
    return (

        <div className="container-fluid">
              <div class="row">
                  <div class="title">To-Do List</div>
              </div>
        </div>

    );
  }
}

export default App;
